import React from "react";
import ScrollAnimation from "react-animate-on-scroll";
import { FiMail } from "react-icons/fi";

const callToActionData = {
  title: "Ready to start creating a standard website?",
  subtitle: "Finest choice for your home & office",
  btnText: "Purchase Doob",
};

const CalltoActionOne = () => {
  return (
    <div
      className="rn-callto-action clltoaction-style-default bg_image bg_image_fixed "
      style={{
        backgroundImage: `url(${process.env.PUBLIC_URL}/images/timeline/subs1.jpg)`,
        maxHeight: "300px",
      }}
      data-black-overlay="7"
    >
      <div className="container">
        <div className="row">
          <div className="col-lg-12">
            <div className="inner">
              <div
                className="content text-center"
                style={{
                  marginRight: "350px",
                  marginLeft: "350px",
                  //   backgroundColor: "red",
                }}
              >
                <h2 className="title mb--0">Маркетер танд зориулав</h2>
                <p>
                  Танд болон таны бизнест хэрэгтэй маркетингийн сонирхолтой
                  боломж болон саналуудыг цаг алдалгүй хүлээн аваарай
                </p>
                <form
                  className="blog-search"
                  action="#"
                  // onSubmit={handleAddFormSumbit}
                >
                  <input
                    type="text"
                    name="name"
                    // onChange={handleAddFormChange}
                    placeholder="И-мэйл хаягаа бичнэ үү  "
                  />
                  <button className="search-button " type="submit">
                    <FiMail />
                  </button>
                </form>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
export default CalltoActionOne;
